import React from 'react';
import Paginator from '../common/paginator/Paginator.tsx'
import User from './User.jsx'

type propsType = {
    h:string
}
type Props = {
    onPageChanged:() => void
    currentPage:number
    totalUsersCount:number
    pageSize:number
    selectedPage:number
    users:Array<User>
    props:propsType
}
let Users:React.FC<Props> = ({onPageChanged,currentPage,totalUsersCount,pageSize,selectedPage,users,...props}) => {
    return (
            <section>
                <h2>{props.h}</h2>
                <Paginator currentPage={currentPage} selectedPage={selectedPage} onPageChanged={onPageChanged} totalItemsCount={totalUsersCount} pageSize={pageSize} portionSize={3}/>
                <ul>
                    {
                    users.map( u => <User user={u} key={u.id} folowingInProgress={props.folowingInProgress} unfollow={props.unfollow} follow={props.follow}/>)
                    }
                </ul>
            </section>
        )
    }

export default Users;
